import MenuItems from "./MenuItems";
import ElementItem from "./ElementItem";
import stylesMenu from "./stylesMenu.module.css";

function Menu(props) {
  return (
    <div>
      <MenuItems />
      <p>Булки</p>
      <div className={stylesMenu.box}>
        <ElementItem {...props} />
      </div>
    </div>
  );
}

export default Menu;
